import React from "react";
const Home = () => {
	return (
		<>
			<div className="container" style={{ marginTop: "100px" }}>
				<div className="row">
					<div className="col" style={{ textAlign: "center" }}>
						<h1
							style={{
								fontSize: "80px",
								marginBottom: "40px",
							}}
						>
							Welcome to Book Store.
						</h1>
						<p style={{ fontSize: "30px", marginBottom: "50px" }}>
							You just landed to the right place.
							<br />
							Here you will be provided with variety of books of different
							authors.
							<br />
							Click on the button below to get idea of your choice.
						</p>
						<hr />
						<a class="btn btn-lg btn-outline-primary" href="/books" role="button">
							Browse Books
						</a>
					</div>
				</div>
			</div>
		</>
	);
};

export default Home;
